@AtlanteanLordZ @AZgeopolitics "largest war" - not largest in terms of territory/manpower, rather the number of countries involved;
"thoroughly defeated" - not defeated yet + war isn't over
"3rd world Ukraine" - with ammo/intel support from many-many countries

@MechanicznaC @Unlucky0bserver @Hichame171 @GeromanAT Rus govt spent 8 yrs refusing requests from LPR &amp; DPR for annexation

Rus insisted solution was for them to remain in Ukraine, on basis that Kiev govt would stop killing ethnic Russians &amp; grant them some autonomy

In early Feb, Kiev ramped up bombardment of Donbass civilian areas

@tonyannett I'm sure Ukraine would happily engage in negotiations to allow Russia to peacefully withdraw from their invasion.
After due reparations are made, I'm sure negotiations for a peaceful future can be held.
The Ukraine deaths are not  "pointless". Russia invaded their country.
